// src/modules/trafficEstimation/TrafficEstimationModule.jsx
import React, { useState } from "react";
import { useLanguage } from "../../i18n/LanguageContext";
import { getTrafficEstimationStrings } from "../../i18n/trafficEstimationStrings";
import {
  computeEstimatedTraffic,
  VEHICLE_KEYS
} from "./calculations";

// Labels per vehicle key (you can later i18n this like Module 1)
const VEHICLE_LABELS = {
  passengerGasoline: "Passenger car – gasoline (휘발유)",
  passengerDiesel: "Passenger car – diesel (경유)",
  busSmall: "Bus – small (소형)",
  busLarge: "Bus – large (대형)",
  truckSmall: "Truck – small (소형)",
  truckMedium: "Truck – medium (중형)",
  truckLarge: "Truck – large (대형)",
  truckSpecial: "Special (특수)"
};

// Default numbers from the Excel example
const DEFAULT_DIRECTION_INPUT = {
  year: 2222,
  passengerAADT: 83007, // I48
  busSmall: 0,          // E38/E55
  busLarge: 815,        // F38/F55
  truckSmall: 14331,    // G38/G55
  truckMedium: 3020,    // H38/H55
  truckLarge: 332,      // I38/I55
  truckSpecial: 862     // J38/J55
};

export default function TrafficEstimationModule() {
  const [dir1, setDir1] = useState({ ...DEFAULT_DIRECTION_INPUT });
  const [dir2, setDir2] = useState({ ...DEFAULT_DIRECTION_INPUT });

  const result1 = computeEstimatedTraffic(dir1);
  const result2 = computeEstimatedTraffic(dir2);

  const handleChange = (setter, field, value) => {
    setter((prev) => ({
      ...prev,
      [field]:
        field === "year"
          ? Number(value) || ""
          : Number(value) || 0
    }));
  };

  return (
    <section style={outerSection}>
      <h2 style={{ marginTop: 0 }}>Module 2 – Estimated traffic volume (추정교통량)</h2>

      <p style={explanation}>
        This module reproduces the Excel block around{" "}
        <strong>“1) 추정교통량 / 2) 추정교통량”</strong> in
        <code>환기량 산정</code>:
        it splits passenger cars into 60% gasoline and 40% diesel, adds bus
        and truck categories, and computes total daily traffic (AADT) and
        heavy-vehicle mix <strong>Pt</strong>.
      </p>

      <div style={twoColumn}>
        {/* Direction 1: Masan → Jinju */}
        <DirectionCard
          title="1) 추정교통량 – 마산 ⇒ 진주"
          state={dir1}
          onChange={setDir1}
          result={result1}
        />

        {/* Direction 2: Jinju → Masan */}
        <DirectionCard
          title="2) 추정교통량 – 진주 ⇒ 마산"
          state={dir2}
          onChange={setDir2}
          result={result2}
        />
      </div>
    </section>
  );
}

function DirectionCard({ title, state, onChange, result }) {
  const { year, passengerAADT, busSmall, busLarge,
          truckSmall, truckMedium, truckLarge, truckSpecial } = state;

  const handle = (field) => (e) => {
    const value = e.target.value;
    onChange((prev) => ({
      ...prev,
      [field]:
        field === "year"
          ? Number(value) || ""
          : Number(value) || 0
    }));
  };

  return (
    <div style={card}>
      <h3 style={{ marginTop: 0 }}>{title}</h3>

      {/* Top row: target year + summary */}
      <div style={headerRow}>
        <div style={fieldGroup}>
          <label style={label}>목표년도 (Target year)</label>
          <input
            type="number"
            value={year}
            onChange={handle("year")}
            style={input}
          />
        </div>

        <div style={summaryBox}>
          <div style={summaryLine}>
            <span>Total AADT (합계, 대/일)</span>
            <strong>
              {result.totalAadt ? Math.round(result.totalAadt).toLocaleString() : "-"}
            </strong>
          </div>
          <div style={summaryLine}>
            <span>Heavy-vehicle mix Pt (%)</span>
            <strong>
              {result.heavyVehicleMixPt?.toFixed
                ? result.heavyVehicleMixPt.toFixed(2)
                : result.heavyVehicleMixPt}
            </strong>
          </div>
        </div>
      </div>

      {/* Input fields for base counts (I, F..J in Excel) */}
      <div style={inputsGrid}>
        <div style={fieldGroup}>
          <label style={label}>승용차 전체 AADT (I48/I65, 대/일)</label>
          <input
            type="number"
            value={passengerAADT}
            onChange={handle("passengerAADT")}
            style={input}
          />
        </div>

        <div style={fieldGroup}>
          <label style={label}>버스 소형 AADT (E열, 대/일)</label>
          <input
            type="number"
            value={busSmall}
            onChange={handle("busSmall")}
            style={input}
          />
        </div>

        <div style={fieldGroup}>
          <label style={label}>버스 대형 AADT (F열, 대/일)</label>
          <input
            type="number"
            value={busLarge}
            onChange={handle("busLarge")}
            style={input}
          />
        </div>

        <div style={fieldGroup}>
          <label style={label}>트럭 소형 AADT (G열, 대/일)</label>
          <input
            type="number"
            value={truckSmall}
            onChange={handle("truckSmall")}
            style={input}
          />
        </div>

        <div style={fieldGroup}>
          <label style={label}>트럭 중형 AADT (H열, 대/일)</label>
          <input
            type="number"
            value={truckMedium}
            onChange={handle("truckMedium")}
            style={input}
          />
        </div>

        <div style={fieldGroup}>
          <label style={label}>트럭 대형 AADT (I열, 대/일)</label>
          <input
            type="number"
            value={truckLarge}
            onChange={handle("truckLarge")}
            style={input}
          />
        </div>

        <div style={fieldGroup}>
          <label style={label}>특수 AADT (J열, 대/일)</label>
          <input
            type="number"
            value={truckSpecial}
            onChange={handle("truckSpecial")}
            style={input}
          />
        </div>
      </div>

      {/* Results table: row 38 & 39 equivalents */}
      <ResultsTable result={result} />
    </div>
  );
}

function ResultsTable({ result }) {
  const { counts, mixPercents, mixPercentSum, heavyVehicleMixPt } = result;

  return (
    <table style={table}>
      <thead>
        <tr>
          <th style={th}>Vehicle type</th>
          <th style={th}>Daily volume (대/일)</th>
          <th style={th}>Mix (%)</th>
        </tr>
      </thead>
      <tbody>
        {VEHICLE_KEYS.map((key) => (
          <tr key={key}>
            <td style={td}>{VEHICLE_LABELS[key]}</td>
            <td style={tdRight}>
              {counts && counts[key] != null
                ? Math.round(counts[key]).toLocaleString()
                : "-"}
            </td>
            <td style={tdRight}>
              {mixPercents && mixPercents[key] != null
                ? mixPercents[key].toFixed(2)
                : "-"}
            </td>
          </tr>
        ))}
        <tr>
          <td style={{ ...td, fontWeight: "bold" }}>합계 / Total</td>
          <td style={{ ...tdRight, fontWeight: "bold" }}>
            {result.totalAadt
              ? Math.round(result.totalAadt).toLocaleString()
              : "-"}
          </td>
          <td style={{ ...tdRight, fontWeight: "bold" }}>
            {mixPercentSum != null ? mixPercentSum.toFixed(2) : "-"}
          </td>
        </tr>
        <tr>
          <td style={td}>대형차 혼입율 Pt (F+H+I+J)</td>
          <td style={tdRight}>–</td>
          <td style={{ ...tdRight, fontWeight: "bold" }}>
            {heavyVehicleMixPt != null ? heavyVehicleMixPt.toFixed(2) : "-"}
          </td>
        </tr>
      </tbody>
    </table>
  );
}

